        {
            name:'purchase books',
            id:uuidV4()
         },
         {
            name:'do purchase books',
            id:uuidV4()
         },
         {
            name:'do excercise',
            id:uuidV4()
         }
   ])
   return (
       <div className="list__components">
           <button style={{color:"white",backgroundColor:"black",padding:"5px 20px"}}>Add</button>
       </div>
   )
}
export default ListComponent;
